[{"location":"#PSRDatabase-Documentation","page":"Home","title":"PSRDatabase Documentation","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"PSRDatabase, or PSRI, is a Julia package that provides an interface to read and write open-source formats for PSR models. It is comprised of three main modules:","category":"page"},{"location":"","page":"Home","title":"Home","text":"OpenStudy: Reads and writes data in the JSON format\nOpenBinary: Reads and writes time series data in the binary format\nPSRDatabase: Reads and writes data in the SQL format","category":"page"},{"location":"#Installation","page":"Home","title":"Installation","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"This package is registered so you can simply add it using Julia's Pkg manager:","category":"page"},{"location":"","page":"Home","title":"Home","text":"julia> import Pkg\n\njulia> Pkg.add(\"PSRDatabase\")","category":"page"},{"location":"#Contributing","page":"Home","title":"Contributing","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Users are encouraged to contributing by opening issues and opening pull requests. If you wish to implement a feature please follow  the JuMP Style Guide","category":"page"}]
